(5,'subida','### se debe limpiar la tabla subida y cargar los datos tal cual están\r\n\r\n##script1 --users\r\nINSERT INTO `admin_tugruero`.`users` \r\n(`login`, `password`, `status`, `date_created`, `date_updated`, `mail`, `mail_alternative`)\r\nSELECT rif, \'03ac674216f3e15c761ee1a5e255f067953623c8b388b4459e13f978d7c846f4\',1, NOW(),NOW(),\'mail@mail.com\',\'mail@mail.com\' \r\nFROM subida s;\r\n\r\n##script2 - - users_data\r\nINSERT INTO `admin_tugruero`.`users_data` \r\n(`id_users`, `first_name`, `second_name`, `first_last_name`, `second_last_name`, `nationality`, `document`, `birthdate`, `gender`, `phone`, `phone1`, `image`, `certificado_file`, `document_file`,`date_created`, `date_updated`, `location`, `zone_work`\r\n)\r\n	\r\nSELECT u.id_user, nombres,NULL,apellidos, NULL, \'V\', rif, NULL,\'M\',celular,celular,NULL,NULL,NULL,NOW(),NOW(),NULL,NULL\r\nFROM subida s\r\nINNER JOIN users u ON u.login = s.rif;\r\n##script 3 -- company\r\nINSERT INTO `admin_tugruero`.`company` \r\n(`responsible_name`, `responsible_cedula`, `num_cuenta`, `rif`, `id_bank`, `razon_social`, `status`, `date_created`, `date_updated`, `company_name`, `tipo_cuenta`, `location`, `zone_work`,`club_gruas`, `num_socio`\r\n)\r\nSELECT CONCAT(nombres,\' \', apellidos ),rif,NULL,rif,1, CONCAT(nombres,\' \', apellidos ),1,NOW(),NOW(),CONCAT(nombres,\' \', apellidos ),1,NULL, NULL, NULL,NULL\r\nFROM subida s;\r\n\r\n##script 4 -- users_company\r\n\r\nINSERT INTO `admin_tugruero`.`users_company` \r\n(`id_user`,`id_company`,`status`,`date_created`,`date_updated`)\r\nSELECT u.id_user, c.id,1,NOW(),NOW()\r\nFROM subida s\r\nINNER JOIN company c ON c.rif = s.rif\r\nINNER JOIN users u ON u.login = c.rif;\r\n\r\n##script 5 -- users_perms\r\n\r\nINSERT INTO `admin_tugruero`.`users_perms` \r\n(`id_user`,`id_perms`,`status`,	`date_created`,	`date_updated`)\r\nSELECT u.id_user, 3,1,NOW(),NOW()\r\nFROM subida s\r\nINNER JOIN company c ON c.rif = s.rif\r\nINNER JOIN users u ON u.login = c.rif;\r\n\r\n## script 6 -- crear tabla para pase\r\n\r\nDROP TABLE pase;\r\nCREATE TABLE pase AS \r\nSELECT u.id_user, s.*\r\nFROM subida s\r\nINNER JOIN company c ON c.rif = s.rif\r\nINNER JOIN users u ON u.login = c.rif;\r\n\r\n## script 7 -- insertar en AWS Grueros, en base a la tabla pase\r\n\r\nINSERT INTO `TuGruero`.`Grueros` \r\n(`idGrua`, 	`Nombre`, 	`Apellido`, 	`Placa`, `Modelo`, `Color`, `Celular`, `Cedula`, `Clave`, `Condicion`, `NumServicios`, `TotalTrato`, `TotalPresencia`, `TotalVehiculo`, `Rating`, `location`,`zone_work`)\r\nSELECT id_user,nombres, apellidos, \'AAABBB\',\'Plataforma criolla\', \'BLANCO\', celular, rif, \'1234\', \'Activo\', 0,0,0,0,0,NULL, NULL FROM pase\r\n\r\n## script 8 -- insertar en AWS Gruas, en base a la tabla pase\r\n\r\n\r\nINSERT INTO `TuGruero`.`Gruas` \r\n(`idGrua`, `Disponible`, `Latitud`, `Longitud`, `LastUpdate`, `Token`, `DeviceID`)\r\nSELECT id_user, \'NO\',NULL,NULL,NULL,NULL,NULL FROM pase;');

